package jpegquality

import (
	"encoding/base64"
	"log"
	"os"
	"testing"
)

func init() {
	SetLogger(log.New(os.Stderr, "test-", log.Ltime|log.Lshortfile))
}

func TestJpegQuality(t *testing.T) {
	var (
		cases = []struct {
			s string // base64 source
			q int    // quality value
			e bool   // has error
		}{
			{jpegData1, 76, false},
			{jpegData2, 88, false},
			{pngData, 0, true},
		}
	)
	for _, c := range cases {
		buf, err := base64.StdEncoding.DecodeString(c.s)
		if err != nil {
			t.Fatal(err)
		}

		j, err := NewWithBytes(buf)
		if err != nil {
			if !c.e {
				t.Fatal(err)
			} else {
				continue
			}
		}
		q := j.Quality()
		t.Logf("jpeg quality %d", q)
		if q != c.q {
			t.Errorf("mismatch quality %d", q)
		}
	}

}

const (
	jpegData1 = ``
	jpegData2 = ``
	pngData   = `iVBORw0KGgoAAAANSUhEUgAAACAAAAAgAgMAAAAOFJJnAAAABGdBTUEAAYagMeiWXwAAAANzQklUAQEBfC53ggAAAAxQTFRFAP8A/wAA//8AAAD/ZT8rugAAACJJREFUGJVj+B+6igGEGfAw8MnBGKugLHwMqNL/+BiDzD0AvUl/gW0qyvsAAAAASUVORK5CYII=`
)
